import "./App.css";
import Users from "./components/Users";
import { Albums, Example } from "./components/Albums";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Navbar from "./components/NavBar";

function App() {
  return (
    <>
    <Navbar></Navbar>
      <Router>
        <Switch>
          <Route path="/albums" >
              <Albums></Albums>
          </Route>
          <Route path="/" >
              <Users></Users>
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
